import React from "react";
import { useNavigate } from "react-router-dom";

export const HomeData = [
  {
    imgurl: "https://example.com/msdhoni.jpg",
    heading: "MS Dhoni",
    content: "MS Dhoni, the former Indian captain, led India to multiple ICC trophies and is known for his calm demeanor and finishing abilities.",
  },
  {
    imgurl: "https://example.com/viratkohli.jpg",
    heading: "Virat Kohli",
    content: "Virat Kohli, one of the modern greats, is known for his aggressive batting style and passion for the game, with numerous records to his name.",
  },
  {
    imgurl: "https://akm-img-a-in.tosshub.com/indiatoday/images/story/202505/rohit-sharma-014231946-16x9_0.jpg?VersionId=QsmtFd4Ds_pQ0Ne.Jud9LuVJUCZrLd3T&size=690:388",
    heading: "Rohit Sharma",
    content: "Rohit Sharma, the 'Hitman' of Indian cricket, is known for his elegant stroke play and is the only player with three double centuries in ODIs.",
  },
];

const Home = () => {
  const navigate = useNavigate();

  const handleNavigation = (index) => {
    navigate(`/page/${index}`);
  };

  return (
    <div>
      {HomeData.map((data, index) => (
        <div key={index} onClick={() => handleNavigation(index)}>
          <img src={data.imgurl} alt={data.heading} />
          <h1>{data.heading}</h1>
        </div>
      ))}
    </div>
  );
};

export default Home;
